DROP TABLE if EXISTS part;
CREATE TABLE if NOT EXISTS part (
  p_partkey BIGINT,
  p_name STRING,
  p_mfgr STRING,
  p_brand STRING,
  p_type STRING,
  p_size INT,
  p_container STRING,
  p_retailprice DECIMAL(18,2),
  p_comment STRING);

